import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="home-layout">
      <div>
        <h1>Welcome to my collection of art</h1>
        <p>
          Get illustrations and designs with our easy to use app,
          and your products delivered straight to your doorstep.
        </p>
        <Link to="/products" className="btn btn-default">
          Start shopping
        </Link>
      </div>
      <div className="img-container">
        <img
          src="https://wise18.parcours-muenster.de/wp-content/uploads/sofia_cavelius_1-960x1366.jpg"
          // width="350"
          // height="240"
          className="home-image"
          alt=""
        />
      </div>
    </div>
  );
}
